pragma solidity ^0.8.0;

enum OrderStatus {  Confirmed,Pending, Cancelled }
enum OrderItemStatus {Success,  Shipping,Cancelled }
struct OrderItem {
    uint orderItemId;
    uint foodDetailId;
    uint foodId;
    uint quantity;
    uint price;
    OrderItemStatus status;
}
struct OrderItemRequest {
    uint foodId;
    uint foodDetailId;
    uint quantity;
}
