// 1. order k có nhân viên thì staffId 0 , tableId 0
// 2. order có nv, staffId != 0
// 3. order có nv, bàn staffId != 0, tableId !=0
struct Order {
    uint orderId;
    address user;
    string userInfo;
    string note;
    string name;
    string imgage;
    uint  staffId; // nếu staffId = 0 thì k có nhân viên
    uint tableId; // bàn được order nếu = 0 là k có bàn
    OrderItem[] items;
    uint totalAmount;
    OrderStatus status;
    uint timestamp;
}

